import { makeStyles } from "@material-ui/core";
import React from "react";
import Spinner from "../../assets/loadingPage.gif";

const useStyles = makeStyles((theme) => ({
  fpContainer: {
    position: "fixed",
    width: "100%",
    height: "100%",
    top: 0,
    left: 0,
  },
  fpLoader: {
    position: "absolute",
    zIndex: "100",
  },
}));

export default function LoadingSpinner(props) {
  const classes = useStyles();
  return (
    <div className={classes.fpContainer}>
      <img alt="loading" className={classes.fpLoader} src={Spinner} />
    </div>
  );
}
